		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		var root = this;
		var a=0;
		var b=0;
		var c=0;
		var i=2;
		var s=2;
		var t=2;
		var v=2;
		
		
		
		root.startscreen.on('click', function(){
		/*
		Macht das angegebene Objekt sichtbar oder unsichtbar.
		*/
		root.startscreen.visible = false;
		});
		
